#include <iostream>
#include <iomanip>

#include "include/trie.hpp"

#include "include/union_find.hpp"

#include <vector>

#include <string>

#include <unordered_map>

class Solution {
public:
    /**
     * @param words1: the words in paper1
     * @param words2: the words in paper2
     * @param pairs: the similar words pair
     * @return: the similarity of the two papers
     */
    float getSimilarity(
        const std::vector<std::string> &words1, 
        const std::vector<std::string> &words2, 
        const std::vector<std::vector<std::string>> &pairs
    ) {
        float similarity = 0.0f;

        if ( 0 < words1.size() && 0 < words2.size() ) {
            // encode all the string to reduce string comp complexity in later stage:
            std::vector<int> wordsIdx1, wordsIdx2;
            std::vector<std::pair<int, int>> pairsIdx;
            EncodeWords(
                words1, words2, pairs,
                wordsIdx1, wordsIdx2, pairsIdx
            );

            // first, use UnionFind to encode word similarity:
            UnionFind<int> union_find;
            for (const auto &pair: pairsIdx) {
                union_find.Insert(pair.first);
                union_find.Insert(pair.second);

                union_find.Union(pair.first, pair.second);
            }
            
            // then find longest similar subsequence using UnionFind:
            const int N = words1.size();
            const int M = words2.size();
            const int MAX_LENGTH = std::min(N, M);

            // init DP table:
            std::vector<std::vector<int>> lcs_table(2, std::vector<int>(N + 1, 0));

            for (int m = 0; m < M; ++m) {
                const int prev = m % 2;
                const int curr = (m + 1) % 2;

                const int word_idx_2 = wordsIdx2.at(m);

                for (int n = 0; n < N; ++n) {
                    const int word_idx_1 = wordsIdx1.at(n);
    
                    if (
                        word_idx_2 == word_idx_1 ||
                        IsSimilar( union_find, word_idx_2, word_idx_1 )
                    ) {
                        lcs_table[curr][n + 1] = lcs_table[prev][n] + 1;
                    } else {
                        lcs_table[curr][n + 1] = std::max(
                            lcs_table[curr][n], 
                            lcs_table[prev][n + 1]
                        );
                    }

                    if ( MAX_LENGTH == lcs_table[curr][n + 1] ) {
                        return (MAX_LENGTH << 1) / static_cast<float>(N + M);
                    }
                }
            }

            similarity = static_cast<float>(lcs_table[M % 2].back()) * 2 / (N + M);
        }


        return similarity;
    }
private:
    static void EncodeWords(
        const std::vector<std::string> &words1, 
        const std::vector<std::string> &words2, 
        const std::vector<std::vector<std::string>> &pairs,
        std::vector<int> &wordsIdx1,
        std::vector<int> &wordsIdx2,
        std::vector<std::pair<int, int>> &pairsIdx
    ) {
        Trie trie;

        wordsIdx1.clear();
        for (const std::string &word: words1) {
            wordsIdx1.push_back(trie.insert(word));
        }

        wordsIdx2.clear();
        for (const std::string &word: words2) {
            wordsIdx2.push_back(trie.insert(word));
        }

        pairsIdx.clear();
        for (const auto &word_pair: pairs) {
            const std::string &word_x = word_pair.at(0);
            const std::string &word_y = word_pair.at(1);

            pairsIdx.emplace_back( 
                std::pair<int, int>(
                    trie.insert(word_x), 
                    trie.insert(word_y)
                ) 
            );
        }
    }

    static bool IsSimilar(
        UnionFind<int> &union_find,
        const int word_idx_2, const int word_idx_1
    ) {
        if (
            union_find.IsInside(word_idx_2) && 
            union_find.IsInside(word_idx_1) && 
            union_find.Find(word_idx_2) == union_find.Find(word_idx_1)
        ) {
            return true;
        }

        return false;
    }
};

